tion.fromJson(Map<String, dynamic> json) => Location(    address: json["address"],    lng: json["lng"]?.toDouble(),    lat: json["lat"]?.toDouble(),  );  Map<String, dynamic> toJson() => {    "address": address,    "lng": lng,    "lat": lat,  };}